import React from 'react'
import { View,Text,StyleSheet } from 'react-native'

export default function App() {
  return (
    <View style={styles.HeadView}>
      <View style={styles.flexOneView}>
        <View style={{flex:0.6,backgroundColor:'blue',borderRadius:10}}></View>
        <View style={{flex:0.3,backgroundColor:'red',borderRadius:10}}></View>
      </View>
      <View style={styles.flexTwoView}>
        <View style={{flex:0.3,backgroundColor:'red',borderRadius:10}}></View>
        <View style={{flex:0.6,backgroundColor:'blue',borderRadius:10}}></View>
      </View>
      <View style={styles.flexThreeView}>
      <View style={{flex:0.3,backgroundColor:'red',borderRadius:10}}></View>
        <View style={{flex:0.3,backgroundColor:'blue',borderRadius:10}}></View>
        <View style={{flex:0.3,backgroundColor:'yellow',borderRadius:10}}></View>
      </View>
      <View style={styles.flexFourView}>
      <View style={{flex:0.3,backgroundColor:'red',borderRadius:10}}></View>
        <View style={{flex:0.6,backgroundColor:'blue',borderRadius:10}}></View>
      </View>
      <View style={styles.flexFiveView}>
      </View>
    </View>
  )
}
const styles=StyleSheet.create({
HeadView:{
    flex:1
},
flexOneView:{
   flex:1,
   flexDirection:'row',
   justifyContent:'space-around'
},
